  return (
    <Layout>
      <div className=" home no-main-padding d-flex justify-center">
        <div className="paints-container d-flex justify-center">
          <img className="paint" src="/images/paint1.jpg" alt="" />
        </div>
      </div>
      <style jsx>
        {`
          .home {
            background-image: url("/images/home5-empty.png");
            background-size: cover;
            background-position: center;
            height: calc(100vh - 160px);
            width: calc(100vw - 40px);
            position: fixed;
            top: 140px;
          }
          .paints-container {
          }
          .paint {
            width: 200px;
            height: 200px;
            opacity: 0.5;
          }
        `}
      </style>
    </Layout>
  );
};

export default Home;
